import React from "react"
import CountButton from "./CountButton"

const App = () => {
    return (
        <div>
            <CountButton incrementBy={1} buttonColor={'blue'} borderRadius={'2px'}/>
            <CountButton incrementBy={5} buttonColor={'green'}
            borderRadius={'10px'}/>
            <CountButton incrementBy={7} buttonColor={'yellow'} borderRadius={'10px'}/>
        </div>
    )
}

export default App 

//props is a value that you pass into a component to inform what it does e.g. incrementBy
